import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";
import SignIn from "./SignIn";
import Book from "./Book"
function App() {
  return (
    <Router>
      <Switch>
        <Route path="/signin" component={SignIn} />
        <Route path="/book" component={Book}/>
      </Switch>
    </Router>
  );
}

export default App;
